{"version":3,"sources":["webpack://metronic/../demo1/src/js/pages/features/calendar/google.js"],"names":[],"mappings":";;;;;;AAAa;;AAEb;;AAEA;AACA;AACA;AACA;AACA;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA,iBAAiB;;AAEjB;;AAEA;AACA;AACA;;AAEA;AACA,mCAAmC,sBAAsB;AACzD,mCAAmC,qBAAqB;AACxD,kCAAkC;AAClC,iBAAiB;;AAEjB;;AAEA;AACA;AACA;;AAEA;AACA;AACA;AACA;;AAEA;AACA;;AAEA;AACA;AACA;AACA;AACA,iBAAiB;;AAEjB;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA,qBAAqB;AACrB;AACA,iBAAiB;;AAEjB;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA,yBAAyB;AACzB;AACA,yBAAyB;AACzB;AACA;AACA;AACA;AACA,aAAa;;AAEb;AACA;AACA;AACA,CAAC;;AAED;AACA;AACA,CAAC","file":"js/pages/features/calendar/google.js","sourcesContent":["\"use strict\";\r\n\r\nvar KTCalendarGoogle = function() {\r\n\r\n    return {\r\n        //main function to initiate the module\r\n        init: function() {\r\n            var calendarEl = document.getElementById('kt_calendar');\r\n            var calendar = new FullCalendar.Calendar(calendarEl, {\r\n                plugins: [ 'interaction', 'dayGrid', 'timeGrid', 'list', 'googleCalendar' ],\r\n\r\n                isRTL: KTUtil.isRTL(),\r\n                header: {\r\n                    left: 'prev,next today',\r\n                    center: 'title',\r\n                    right: 'dayGridMonth,timeGridWeek,timeGridDay'\r\n                },\r\n\r\n                displayEventTime: false, // don't show the time column in list view\r\n\r\n                height: 800,\r\n                contentHeight: 780,\r\n                aspectRatio: 3,  // see: https://fullcalendar.io/docs/aspectRatio\r\n\r\n                views: {\r\n                    dayGridMonth: { buttonText: 'month' },\r\n                    timeGridWeek: { buttonText: 'week' },\r\n                    timeGridDay: { buttonText: 'day' }\r\n                },\r\n\r\n                defaultView: 'dayGridMonth',\r\n\r\n                editable: true,\r\n                eventLimit: true, // allow \"more\" link when too many events\r\n                navLinks: true,\r\n\r\n                // THIS KEY WON'T WORK IN PRODUCTION!!!\r\n                // To make your own Google API key, follow the directions here:\r\n                // http://fullcalendar.io/docs/google_calendar/\r\n                googleCalendarApiKey: 'AIzaSyDcnW6WejpTOCffshGDDb4neIrXVUA1EAE',\r\n\r\n                // US Holidays\r\n                events: 'en.usa#holiday@group.v.calendar.google.com',\r\n\r\n                eventClick: function(event) {\r\n                    // opens events in a popup window\r\n                    window.open(event.url, 'gcalevent', 'width=700,height=600');\r\n                    return false;\r\n                },\r\n\r\n                loading: function(bool) {\r\n                    return;\r\n\r\n                    /*\r\n                    KTApp.block(portlet.getSelf(), {\r\n                        type: 'loader',\r\n                        state: 'success',\r\n                        message: 'Please wait...'\r\n                    });\r\n                    */\r\n                },\r\n\r\n                eventRender: function(info) {\r\n                    var element = $(info.el);\r\n\r\n                    if (info.event.extendedProps && info.event.extendedProps.description) {\r\n                        if (element.hasClass('fc-day-grid-event')) {\r\n                            element.data('content', info.event.extendedProps.description);\r\n                            element.data('placement', 'top');\r\n                            KTApp.initPopover(element);\r\n                        } else if (element.hasClass('fc-time-grid-event')) {\r\n                            element.find('.fc-title').append('<div class=\"fc-description\">' + info.event.extendedProps.description + '</div>');\r\n                        } else if (element.find('.fc-list-item-title').lenght !== 0) {\r\n                            element.find('.fc-list-item-title').append('<div class=\"fc-description\">' + info.event.extendedProps.description + '</div>');\r\n                        }\r\n                    }\r\n                }\r\n            });\r\n\r\n            calendar.render();\r\n        }\r\n    };\r\n}();\r\n\r\njQuery(document).ready(function() {\r\n    KTCalendarGoogle.init();\r\n});\r\n"],"sourceRoot":""}